            function backToTop() {
                let scrollPos = 0;
                const element = $('#back2top');
                $(window).scroll(() => {
                    const scrollCur = $(window).scrollTop();
                    if (scrollCur > scrollPos) {
                        if (scrollCur > 500) {
                            element.addClass('active');
                        }
                        else {
                            element.removeClass('active');
                        }
                    }
                    else {
                        element.removeClass('active');
                    }
                    scrollPos = scrollCur;
                });
                element.on('click', () => {
                    $('html, body').animate({
                        scrollTop: '0px',
                    }, 800);
                });
            }
            function modalInit() {
                const modal = $('.ps-modal');
                if (modal.length) {
                    if (modal.hasClass('active')) {
                        $('body').css('overflow-y', 'hidden');
                    }
                }
                modal.find('.ps-modal__close, .ps-btn--close').on('click', function (e) {
                    e.preventDefault();
                    $(this)
                        .closest('.ps-modal')
                        .removeClass('active');
                });
                $('.ps-modal-link').on('click', function (e) {
                    e.preventDefault();
                    const target = $(this).attr('href');
                    $(target).addClass('active');
                    $('body').css('overflow-y', 'hidden');
                });
                $('.ps-modal').on('click', (event) => {
                    if (!$(event.target).closest('.ps-modal__container').length) {
                        modal.removeClass('active');
                        $('body').css('overflow-y', 'auto');
                    }
                });
            }
            function searchInit() {
                const searchbox = $('.ps-search');
                $('.ps-search-btn').on('click', (e) => {
                    e.preventDefault();
                    searchbox.addClass('active');
                });
                searchbox.find('.ps-btn--close').on('click', (e) => {
                    e.preventDefault();
                    searchbox.removeClass('active');
                });
            }
            function productFilterToggle() {
                $('.ps-filter__trigger').on('click', function (e) {
                    e.preventDefault();
                    const el = $(this);
                    el.find('.ps-filter__icon').toggleClass('active');
                    el.closest('.ps-filter')
                        .find('.ps-filter__content')
                        .slideToggle();
                });
                if ($('.ps-sidebar--home').length > 0) {
                    $('.ps-sidebar--home > .ps-sidebar__header > a').on('click', function (e) {
                        e.preventDefault();
                        $(this)
                            .closest('.ps-sidebar--home')
                            .children('.ps-sidebar__content')
                            .slideToggle();
                    });
                }
            }
            function mainSlider() {
                const homeBanner = $('.ps-carousel--animate');
                homeBanner.slick({
                    autoplay: true,
                    speed: 1000,
                    lazyLoad: 'progressive',
                    arrows: false,
                    fade: true,
                    dots: true,
                    prevArrow: '<i class="slider-prev ba-back"></i>',
                    nextArrow: '<i class="slider-next ba-next"></i>',
                });
            }
            function subscribePopup() {
                const subscribe = $('#subscribe');
                const time = subscribe.data('time');
                setTimeout(() => {
                    if (subscribe.length > 0) {
                        subscribe.addClass('active');
                        $('body').css('overflow', 'hidden');
                    }
                }, time);
                $('.ps-popup__close').on('click', function (e) {
                    e.preventDefault();
                    $(this)
                        .closest('.ps-popup')
                        .removeClass('active');
                    $('body').css('overflow', 'auto');
                });
                $('#subscribe').on('click', (event) => {
                    if (!$(event.target).closest('.ps-popup__content').length) {
                        subscribe.removeClass('active');
                        $('body').css('overflow-y', 'auto');
                    }
                });
            }
            function stickySidebar() {
                const sticky = $('.ps-product--sticky');
                let stickySidebar1;
                let stickySidebar2;
                const checkPoint = 992;
                const windowWidth = $(window).innerWidth();
                if (sticky.length > 0) {
                    stickySidebar1 = new StickySidebar('.ps-product__sticky .ps-product__info', {
                        topSpacing: 20,
                        bottomSpacing: 20,
                        containerSelector: '.ps-product__sticky',
                    });
                    if ($('.sticky-2').length > 0) {
                        stickySidebar2 = new StickySidebar('.ps-product__sticky .sticky-2', {
                            topSpacing: 20,
                            bottomSpacing: 20,
                            containerSelector: '.ps-product__sticky',
                        });
                    }
                    if (checkPoint > windowWidth) {
                        stickySidebar1.destroy();
                        stickySidebar2.destroy();
                    }
                }
                else {
                    return false;
                }
            }
            function accordion() {
                const accordion1 = $('.ps-accordion');
                accordion1.find('.ps-accordion__content').hide();
                $('.ps-accordion.active')
                    .find('.ps-accordion__content')
                    .show();
                accordion1.find('.ps-accordion__header').on('click', function (e) {
                    e.preventDefault();
                    if ($(this)
                        .closest('.ps-accordion')
                        .hasClass('active')) {
                        $(this)
                            .closest('.ps-accordion')
                            .removeClass('active');
                        $(this)
                            .closest('.ps-accordion')
                            .find('.ps-accordion__content')
                            .slideUp(350);
                    }
                    else {
                        $(this)
                            .closest('.ps-accordion')
                            .addClass('active');
                        $(this)
                            .closest('.ps-accordion')
                            .find('.ps-accordion__content')
                            .slideDown(350);
                        $(this)
                            .closest('.ps-accordion')
                            .siblings('.ps-accordion')
                            .find('.ps-accordion__content')
                            .slideUp();
                    }
                    $(this)
                        .closest('.ps-accordion')
                        .siblings('.ps-accordion')
                        .removeClass('active');
                    $(this)
                        .closest('.ps-accordion')
                        .siblings('.ps-accordion')
                        .find('.ps-accordion__content')
                        .slideUp();
                });
            }
            function handleLiveSearch() {
                $('body').on('click', (e) => {
                    if ($(e.target).closest('.ps-form--search-header') ||
                        e.target.className === '.ps-form--search-header') {
                        $('.ps-panel--search-result').removeClass('active');
                    }
                });
                $('#input-search').on('keypress', () => {
                    $('.ps-panel--search-result').addClass('active');
                });
            }
            $(() => {
                masonry('.ps-masonry');
                productFilterToggle();
                backToTop();
                mapConfig();
                modalInit();
                searchInit();
                mainSlider();
                parallax();
                stickySidebar();
                accordion();
                handleLiveSearch();
            });
            $(window).on('load', () => {
                $('body').addClass('loaded');
                subscribePopup();
            });
