                        detalles: '<table class="table table-bordered ps-table ps-table--specification">\n\n          <tbody>\n\n            <tr>\n              <td>Color</td>\n              <td>Black, Gray</td>\n            </tr>\n            <tr>\n              <td>Style</td>\n              <td>Ear Hook</td>\n            </tr>\n            <tr>\n              <td>Wireless</td>\n              <td>Yes</td>\n            </tr>\n            <tr>\n              <td>Dimensions</td>\n              <td>5.5 x 5.5 x 9.5 inches</td>\n            </tr>\n            <tr>\n              <td>Weight</td>\n              <td>6.61 pounds</td>\n            </tr>\n            <tr>\n              <td>Battery Life</td>\n              <td>20 hours</td>\n            </tr>\n            <tr>\n              <td>Bluetooth</td>\n              <td>Yes</td>\n            </tr>\n\n          </tbody>\n\n        </table>',
                        descripcion: '<h5>Embodying the Raw, Wayward Spirit of Rock \'N\' Roll</h5>\n\n      <p>Embodying the raw, wayward spirit of rock ‘n’ roll, the Kilburn portable active stereo speaker\n        takes the unmistakable look and sound of Marshall, unplugs the chords, and takes the show on the\n        road.</p>\n\n      <p>Weighing in under 7 pounds, the Kilburn is a lightweight piece of vintage styled engineering.\n        Setting the bar as one of the loudest speakers in its class, the Kilburn is a compact, stout-hearted\n        hero with a well-balanced audio which boasts a clear midrange and extended highs for a sound that is\n        both articulate and pronounced. The analogue knobs allow you to fine tune the controls to your\n        personal preferences while the guitar-influenced leather strap enables easy and stylish travel.</p>\n\n      <img class="mb-30" src="./assets/img/productos/detail/content/description.jpg" alt="">\n\n      <h5>What do you get</h5>\n\n      <p>Sound of Marshall, unplugs the chords, and takes the show on the road.</p>\n\n      <p>Weighing in under 7 pounds, the Kilburn is a lightweight piece of vintage styled engineering.\n        Setting the bar as one of the loudest speakers in its class, the Kilburn is a compact, stout-hearted\n        hero with a well-balanced audio which boasts a clear midrange and extended highs for a sound that is\n        both articulate and pronounced. The analogue knobs allow you to fine tune the controls to your\n        personal preferences while the guitar-influenced leather strap enables easy and stylish travel.</p>\n\n      <p>The FM radio is perhaps gone for good, the assumption apparently being that the jury has ruled in\n        favor of streaming over the internet. The IR blaster is another feature due for retirement – the S6\n        had it, then the Note5 didn’t, and now with the S7 the trend is clear.</p>\n\n      <h5>Perfectly Done</h5>\n\n      <p>Meanwhile, the IP68 water resistance has improved from the S5, allowing submersion of up to five\n        feet for 30 minutes, plus there’s no annoying flap covering the charging port</p>\n\n      <ul class="pl-0">\n        <li>No FM radio (except for T-Mobile units in the US, so far)</li>\n        <li>No IR blaster</li>\n        <li>No stereo speakers</li>\n      </ul>\n\n      <p>If you’ve taken the phone for a plunge in the bath, you’ll need to dry the charging port before\n        plugging in. Samsung hasn’t reinvented the wheel with the design of the Galaxy S7, but it didn’t\n        need to. The Gala S6 was an excellently styled device, and the S7 has managed to improve on that.\n        </p>',
